import Typing from 'react-typing-effect';
import styles from './Header.module.css';

const Header = () => {
  const fullText = 'Wrocław Dom - twój przewodnik w świecie nieruchomości';

  return (
    <header className={styles.header}>
      <img
        className={styles.headerBackground}
        src="./img/layout/wroclaw1.jpg"
        alt="Wroclaw"
      />
      {fullText && (
        <Typing className={`${styles.logo} ${styles.headerText}`}>
          {fullText}
        </Typing>
      )}
    </header>
  );
}

export default Header;
